import {StyleSheet} from 'react-native';

const styles = StyleSheet.create({

    container: {
        position: 'absolute',
        top: 50,
        zIndex: 2,
        flexDirection: 'row',
    },

    logo: {
        width: 100,
        height: 20,
        resizeMode: 'contain',
    },

    menu:{ 
        width: 25,
        height: 25,
        resizeMode: 'contain',
    }

});

export default styles;
